import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import tour1 from '../data'
import tour2 from '../data'
import tour3 from '../data'
// import tour4 from '../data'
import CarouseItem from './components/CarouseItem';
const images =[tour1,tour2,tour3]
const Carousel = ({ image }) => {
    const settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        centerMode: true,
        centerPadding: '0px',
    };
    const renderImages = () =>
        images.map((image, index) => <CarouseItem key={index} image={image} />);
  return (
    <div className='flex items-center justify-center'>
          <div>
              <Slider {...settings}>
                  {renderImages()}
              </Slider>
      </div>
    </div>
  );
}

export default Carousel;
